import {EComponentGroupTitle, EComponentTitle, TComponentGroup} from "~/interfaces/material_components";

const { NAVIGATION } = EComponentGroupTitle;
const {
  BOTTOM_NAVIGATION, BREADCRUMBS, DRAWER, LINK, MENU, STEPPER, TABS
} = EComponentTitle;

const componentGroup: TComponentGroup = {
  iconType: "user",
  title: "Navigation",
  components: [
    { title: "Bottom Navigation", props: [] },
    { title: "Breadcrumbs", props: [] },
    { title: "Drawer", props: [] },
    { title: "Link", props: [] },
    { title: "Menu", props: [] },
    { title: "Stepper", props: [] },
    { title: "Tabs", props: [] }
  ]
};

export default componentGroup;
